function MyComponent() {
  const jsonPanel = useJSONPanel();

  return jsonPanel.isOpen && (
     <JSONPanel
       containerRef={jsonPanel.containerRef}
       jsonHTML={jsonPanel.jsonHTML}
       onClose={() => jsonPanel.close()}
       onCopy={() => jsonPanel.copy()}
     />
   )
}
